        [TestCase]
        public void TestMethod()
        {
            //DataTable results = new DataTable();
            Dictionary<string, Type> columnsAndTypes = new Dictionary<string, Type>();
            columnsAndTypes.Add(orderUId, typeof(string));
            columnsAndTypes.Add(exchange, typeof(string));
            columnsAndTypes.Add(type, typeof(string));
            columnsAndTypes.Add(quantity, typeof(decimal));
            columnsAndTypes.Add(limit, typeof(decimal));
            columnsAndTypes.Add(commissionPaid, typeof(decimal));
            columnsAndTypes.Add(price, typeof(decimal));
            columnsAndTypes.Add(opened, typeof(DateTime));
            columnsAndTypes.Add(closed, typeof(DateTime));
            //columnsAndTypes.Add(profit, typeof(decimal));

            DataTable inputs = CsvToDataTable(operationsDataPathCsv, columnsAndTypes);

            //find all the markets first
            var rowsCollection = inputs.AsEnumerable().OrderBy(r => r[closed]);
            List<string> exchanges = inputs.AsEnumerable().Select(r => (string)r[exchange]).Distinct().OrderBy(e=>e).ToList();

            Dictionary<string, string> parameters = new Dictionary<string, string>();
            parameters.Add("marketName", "usdt-btc");
            parameters.Add("tickInterval", "day");

            List<string> baseCurrencies = FindBaseCurrencies(exchanges);

            DateTime startDate = new DateTime(2017, 1, 1);
            DateTime endDate = startDate.AddDays(367); //367 is nbp limit
            Dictionary<DateTime, decimal> usdAskForDates = GetUsdAskForDates(startDate, endDate);

            ////https://bittrex.com/Api/v2.0/pub/market/GetTicks?marketName=usdt-btc&tickInterval=day
            Dictionary <string, Dictionary <DateTime, decimal>> pairsDayClosingPrices = GetPricesForPairs(baseCurrencies, "https://bittrex.com/Api/v2.0/pub/market/", "GetTicks", parameters);

            foreach (string ex in exchanges)
            {
                string baseAsset = ex.Split('-').First();

                var rowsForThisExchange = rowsCollection
                    .Where(r => r.Field<string>(exchange) == ex)
                    .OrderBy(r => r.Field<DateTime>(closed));

                foreach (DataRow row in rowsForThisExchange)
                {
                    DateTime operationCloseDate = row.Field<DateTime>(closed);

                    if (row.Field<string>(type) == sellType)
                    {

                        var allBuysBefore = rowsForThisExchange.Where(r => r.Field<string>(type) == buyType && r.Field<DateTime>(closed) < operationCloseDate).OrderBy(r => r.Field<DateTime>(closed));
                        decimal sellVolume = row.Field<decimal>(quantity);

                        decimal volumeCounter = 0;

                        //go thru buys until sell volume is filled
                        foreach (DataRow buy in allBuysBefore)
                        {
                            if (RemainingVolume(buy, sell) == 0) //check if all coins sold already
                                continue;

                            int sellNo = 0;

                            //get to lat col with previously sold volume
                            while (buy.Table.Columns.Contains($"{sell}{sellNo.ToString()}"))
                            {
                                // || (decimal)buy[$"sell{sellNo.ToString()}"] != 0)

                                if ((!(buy[$"{sell}{sellNo.ToString()}"] is decimal)))
                                    break;
                                else
                                    sellNo++;
                            }

                            if (volumeCounter >= sellVolume)
                                break;

                            string anotherSellCol = $"{sell}{sellNo.ToString()}";
                            if (!buy.Table.Columns.Contains(anotherSellCol))
                            {
                                buy.Table.Columns.Add(anotherSellCol, typeof(decimal));
                                buy[anotherSellCol] = new decimal(0);
                            }

                            decimal remainingVolume = RemainingVolume(buy, sell); //from this buy

                            if (remainingVolume < 0)
                                throw new Exception("cant sell more than own");

                            decimal sellingFomHere = remainingVolume > sellVolume ? sellVolume : remainingVolume;
                            buy[anotherSellCol] = sellingFomHere;

                            decimal buyPriceForSellingAmount = buy.Field<decimal>(price) / buy.Field<decimal>(quantity) * sellingFomHere;
                            decimal sellPriceForSellingAmount = sellingFomHere / sellVolume * row.Field<decimal>(price);

                            decimal profitInBaseAsset = sellPriceForSellingAmount - buyPriceForSellingAmount;

                            //decimal profit = sellingFomHere / buy.Field<decimal>(quantity) * row.Field<decimal>(price)/sellingFomHere;

                            string baseAssetColName = $"{baseAsset} {profit}";
                            if (!buy.Table.Columns.Contains(baseAssetColName))
                                buy.Table.Columns.Add(baseAssetColName, typeof(decimal));

                            if (!(buy[baseAssetColName] is decimal))
                                buy[baseAssetColName] = new decimal(0);

                            buy[baseAssetColName] = buy.Field<decimal>(baseAssetColName) + profitInBaseAsset;
                            volumeCounter += sellingFomHere;
                        }
                    }

                    //fill exchange rate which we have 
                    string rowBaseCurrency = row[exchange].ToString().Split('-').First();
                    string rowBaseCurrencyPair = $"usdt-{rowBaseCurrency}";

                    if (!row.Table.Columns.Contains(rowBaseCurrencyPair))
                        row.Table.Columns.Add(rowBaseCurrencyPair,typeof(decimal));

                    //find the date and fill the price
                    if (rowBaseCurrency == "USDT")
                        row[rowBaseCurrencyPair] = 1;
                    else 
                        row[rowBaseCurrencyPair] = pairsDayClosingPrices[rowBaseCurrency][pairsDayClosingPrices[rowBaseCurrency].Keys.First(k => k.DayOfYear == operationCloseDate.DayOfYear && k.Year == operationCloseDate.Year)];

                    //add the usd price from previous day
                    string usdPriceColum = "USD/PLN previous day";
                    if (!row.Table.Columns.Contains(usdPriceColum))
                        row.Table.Columns.Add(usdPriceColum,typeof(decimal));

                    decimal prevDayPrice = GetPriceFromDate(operationCloseDate, usdAskForDates);

                    row[usdPriceColum] = prevDayPrice;
                }
            }
            //sort by market then date
            DataTable results = rowsCollection.OrderBy(r => r.Field<string>(exchange)).ThenBy(r => r.Field<DateTime>(closed)).CopyToDataTable();

            RenameColumns(results, colNamesMap);
            Helper h = new Helper();
            h.DataTableToExcel(results, true, $@"C:\temp\testOut\{Guid.NewGuid().ToString()}.xlsx");
        }


        public decimal GetPriceFromDate(DateTime date, Dictionary<DateTime, decimal> prices)
        {
            decimal price = 0;
            //price from this day or first from the past (weekends are the problem)
            foreach(var pair in prices)
            {
                if (date.Date > pair.Key.Date)
                    price = pair.Value;
                else
                    break;
            }
            return price;
        }

        public List<string> FindBaseCurrencies(List<string> exchanges)
        {
            //create list of base currencies
            HashSet<string> tmp = new HashSet<string>();

            foreach (var ex in exchanges)
                tmp.Add(ex.Split('-').First());

            List<string> baseCurrencies = tmp.ToList();
            return baseCurrencies;
        }
        
        public Dictionary<DateTime, decimal> DeserializeBittrexData(string bittrexPricesJson)
        {
            Dictionary<DateTime, decimal> dateClosingPrice = new Dictionary<DateTime, decimal>();

            var definition = new {
                success = true,
                message = "",
                result = new CandleDataBittrex[1]
            };

            var data = JsonConvert.DeserializeAnonymousType(bittrexPricesJson, definition);

            if (data.result == null)
                return null;

            foreach (var cd in data.result)
                dateClosingPrice.Add(DateTime.ParseExact(cd.T.Split('T').First(), "yyyy-MM-dd", CultureInfo.InvariantCulture), decimal.Parse(cd.C, CultureInfo.InvariantCulture));

            return dateClosingPrice;
        }

        public Dictionary<DateTime, decimal> GetUsdAskForDates(DateTime startDate, DateTime endDate)
        {
            string requestURL = $"http://api.nbp.pl/api/exchangerates/rates/c/usd/{startDate.ToString("yyyy-MM-dd")}/{endDate.ToString("yyyy-MM-dd")}?format=json";
            
            Dictionary<DateTime, decimal> usdPrices = new Dictionary<DateTime, decimal>();

            var json = GetDataFromAddress<string>(requestURL).GetAwaiter().GetResult();            

        var def = new {
                table = "",
                currency = "",
                code = "",
                rates = new[] { new { no = "", effectiveDate = "", bid = "", ask = "" } }
            };

            var data = JsonConvert.DeserializeAnonymousType(json, def);

            foreach (var rate in data.rates)
                usdPrices.Add(DateTime.ParseExact(rate.effectiveDate, "yyyy-MM-dd", CultureInfo.InvariantCulture), decimal.Parse(rate.ask, CultureInfo.InvariantCulture));

            return usdPrices;
        }


        public Dictionary<string, Dictionary<DateTime, decimal>> GetPricesForPairs(List<string> baseCurrencies, string address, string method, Dictionary<string,string> parameters)
        {
            Dictionary<string, Dictionary<DateTime, decimal>> currencyAndDailyClosingPrices = new Dictionary<string, Dictionary<DateTime, decimal>>();

            foreach (string baseCurrency in baseCurrencies)
            {
                parameters["marketName"] = $"usdt-{baseCurrency}";
                string requestUrl = BuildRequestUrl(address, method, parameters);
                var json = GetDataFromAddress<string>(requestUrl).GetAwaiter().GetResult();

                var des = DeserializeBittrexData(json);

                if (des == null) //just skip as we do not have data
                    continue;

                currencyAndDailyClosingPrices.Add(baseCurrency, des);
            }

            return currencyAndDailyClosingPrices;
        }

        //https://bittrex.com/Api/v2.0/pub/market/GetTicks?marketName=usdt-btc&tickInterval=day
        private string BuildRequestUrl(string baseAddress, string method, Dictionary<string, string> parameters = null)
        {
            if (parameters != null)
            {
                NameValueCollection queryString = HttpUtility.ParseQueryString(string.Empty);

                //NameValueCollection queryString = System.Web.HttpUtility.ParseQueryString(string.Empty);

                foreach (var pair in parameters)
                    queryString[pair.Key] = pair.Value;

                return string.Concat(baseAddress, method, "?", queryString.ToString());
            }
            else
                return string.Concat(baseAddress, method);
        }

        private async Task<T> GetDataFromAddress<T>(string address)
        {
            //todo: think if need to automaticaly close connection
            using (HttpClient client = new HttpClient())
            {
                //client.BaseAddress = new Uri(_baseAddress);

                HttpResponseMessage response = await client.GetAsync(address);

                Type desiredType = typeof(T);

                if (desiredType == typeof(string))
                {
                    return (T)Convert.ChangeType(await response.Content.ReadAsStringAsync(), desiredType);
                }

                throw new InvalidOperationException("unknown requested data type");
            }
            //  string data = await response.Content.ReadAsStringAsync();
        }


        public DataTable CsvToDataTable(string path, Dictionary<string, Type> expectedColumnsAndTypes)
        {
            DataTable dt = new DataTable();

            foreach (var pair in expectedColumnsAndTypes)
                dt.Columns.Add(pair.Key, pair.Value);

            using (GenericParser parser = new GenericParser())
            {
                parser.SetDataSource(path);

                parser.ColumnDelimiter = ';';
                parser.FirstRowHasHeader = true;
                //parser.SkipStartingDataRows = 10;
                parser.MaxBufferSize = 4096;
                parser.MaxRows = int.MaxValue;
                parser.TextQualifier = '\"';
                parser.SkipEmptyRows = true;

                while (parser.Read())
                {
                    DataRow row = dt.NewRow();

                    foreach (var pair in expectedColumnsAndTypes)
                    {
                        //OrderUuid,Exchange,Type,Quantity,Limit,CommissionPaid,Price,Opened,Closed

                        string value = parser[pair.Key];

                        if (pair.Value == typeof(decimal))
                        {
                            row[pair.Key] = string.IsNullOrEmpty(value) ? 0 : decimal.Parse(value, CultureInfo.InvariantCulture);
                        }
                        else if (pair.Value == typeof(DateTime))
                        {
                            row[pair.Key] = DateTime.ParseExact(value, "M/d/yyyy h:mm:ss tt", CultureInfo.InvariantCulture);
                        }
                        else
                        {
                            row[pair.Key] = value;
                        }
                    }

                    dt.Rows.Add(row);
                }
            }
            return dt;
        }

