        public void RenameColumns(DataTable dt, Dictionary<string, string> namesMap)
        {
            foreach (DataColumn c in dt.Columns)
            {
                string newName = string.Empty;
                if (namesMap.TryGetValue(c.ColumnName, out newName))
                    c.ColumnName = newName;
            }
        }

        public decimal RemainingVolume(DataRow row, string sellColumnPrefix)
        {
            //decimal remaining = 0;
            decimal initialQuantity = row.Field<decimal>(quantity);

            foreach (DataColumn c in row.Table.Columns)
            {
                if (c.ColumnName.StartsWith(sellColumnPrefix))
                    initialQuantity -= !(row[c] is decimal) ? 0 : (decimal)row[c];
            }

            return initialQuantity; //remaining
        }

        public int? IndexOfFirstRowWithNullBalance(DataTable table)
        {
            foreach (DataRow r in table.Rows)
                if (r[balance] == null)
                    return (int?)table.Rows.IndexOf(r);

            return null;
        }

        public List<string> FindAllMarkets(DataTable table)
        {
            HashSet<string> hashSet = new HashSet<string>();

            foreach (DataRow row in table.Rows)
                hashSet.Add((string)row[exchange]);

            return hashSet.ToList();
        }

        public decimal BalanceLeft(List<OperationData> operations)
        {
            decimal balanceLeft = 0;
            foreach (var o in operations)
            {
                if (o.Type == buyType)
                    balanceLeft += o.Quantity;
                else if (o.Type == sellType)
                    balanceLeft -= o.Quantity;
                else
                    throw new ArgumentException("invalid operation type");
            }

            return balanceLeft;
        }
